import React from "react";

// import image
import landingImg from "../img/landingImg.jpeg";

// import materia-ui components
import { makeStyles } from "@material-ui/core/styles";
import Box from "@material-ui/core/Box";

// custom css styling
const useStyles = makeStyles({
  coverImg: {
    height: "100vh",
    width: "100vw",
    backgroundImage: `url(${landingImg})`
  }
});

function Front() {
  const classes = useStyles();

  return (
    <>
      <div className={classes.coverImg}>
        <Box justifyContent="center" alignItems="center" display="flex" style={{height: "100vh"}}>
          <Box fontSize={60} color="text.secondary">Jay Kim</Box>
        </Box>
      </div>
    </>
  );
}

export default Front;
